import styled from "styled-components";

const Profile = () => {
	return (
		<>
			<LayoutProfile>
				<Profiles>
					<p>Profile</p>
				</Profiles>
			</LayoutProfile>
		</>
	);
};
export default Profile;

const LayoutProfile = styled.div`
	background-color: red;
	margin:auto	
`;
const Profiles = styled.div`
	background-color: gainsboro;
	width: 50%;

`;
